"239137":{"id":"239137","name":"Asura","slug":"asura","original_title":"阿修羅のごとく","overview":"Na Tóquio de 1979, quatro irmãs descobrem o caso secreto do pai. Suas vidas aparentemente felizes começam a ruir, revelando emoções há muito reprimidas.","first_air_date":"2025-01-09","episode_run_time":0,"vote_average":8.1,"number_of_seasons":1,"number_of_episodes":7,"created_by":["Hirokazu Koreeda"],"production_companies":["BUN-BUKU","Netflix"],"genres":["Drama"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/801476SmpE20vPI5sz9H5vgBYBq.jpg","poster_path":"https://image.tmdb.org/t/p/original/sWLWPrAZIxns2yHguCUghsiKi1b.jpg","cast":["宮沢りえ","尾野真千子","蒼井優","広瀬すず","Masahiro Motoki"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/sWLWPrAZIxns2yHguCUghsiKi1b.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/sWLWPrAZIxns2yHguCUghsiKi1b.jpg","air_date":"2025-01-09","episode_count":7,"overview":"N/A","vote_average":8.3,"episodes":{"1":{"name":"Episódio 1","overview":"Numa manhã de inverno, a reservada Takiko reúne as três irmãs e revela notícias chocantes sobre o caso do pai.","air_date":"2025-01-09","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/4b6OW8MD0zfPq2MCjwY5KDra6h0.jpg","vote_average":7.3},"2":{"name":"Episódio 2","overview":"Abalada pela revelação, Makiko tem um sonho sombrio. As irmãs encontram no jornal local uma carta sobre o caso do pai. Quem será que escreveu?","air_date":"2025-01-09","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/u03dlYaFZM7RFQtRyimuBHcdQGw.jpg","vote_average":8},"3":{"name":"Episódio 3","overview":"Sakiko lida com uma traição dolorosa, Takiko se apaixona, o caso de Tsunako toma um rumo perigoso e Makiko flagra a mãe em um local surpreendente.","air_date":"2025-01-09","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/z6kvL04UbEILudtmiHv49a6jq8Q.jpg","vote_average":9},"4":{"name":"Episódio 4","overview":"Quando Kotaro provoca um incêndio acidentalmente, as irmãs voltam à casa onde passaram a infância e precisam lidar com os danos em meio a brigas e risadas.","air_date":"2025-01-09","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/7GdV2g9IFxfTU8sFAYhGf4jmAW9.jpg","vote_average":7.5},"5":{"name":"Episódio 5","overview":"O caos toma conta e os egos explodem: Kotaro traz um inquilino, Tsunako conhece a noiva do filho, Makiko lida com suspeitas e a família se reúne para um casamento.","air_date":"2025-01-09","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/r0G6I1Fv8NCtUDsy9pjX2SjkLSD.jpg","vote_average":8},"6":{"name":"Episódio 6","overview":"Enquanto Sakiko enfrenta o comportamento imprevisível de Hide, Makiko tenta se distrair arranjando um par para acompanhar a relutante Tsunako no casamento.","air_date":"2025-01-09","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/60Iyv1gd8boZdeL1QUAUGZTORFH.jpg","vote_average":9},"7":{"name":"Episódio 7","overview":"Com situações inesperadas saindo do controle, será que as irmãs Takezawa conseguirão superar as diferenças e as antigas tensões para se apoiarem?","air_date":"2025-01-09","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/n09NmcH4f481c6cLu6BDpP80C61.jpg","vote_average":9}}}}},
