"242875":{"id":"242875","name":"Mão de Ferro","slug":"mao-de-ferro","original_title":"Mano de hierro","overview":"No porto de Barcelona, Joaquín Manchado comanda seu império do tráfico de drogas com mão de ferro. Até que um novo carregamento abala os negócios e a família.","first_air_date":"2024-03-15","episode_run_time":0,"vote_average":6.7,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Lluís Quílez"],"production_companies":["The Mediapro Studio"],"genres":["Crime","Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/4diQCWNckcvrjGhgSYdCBOpu1BP.jpg","poster_path":"https://image.tmdb.org/t/p/original/fri1QUQO4T1enNnVR5Mju77O3oi.jpg","cast":["Eduard Fernández","Chino Darín","Jaime Lorente","Natalia de Molina","Sergi López"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/n7JeVKeYelth8elInKNbIBJq18o.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/n7JeVKeYelth8elInKNbIBJq18o.jpg","air_date":"2024-03-15","episode_count":8,"overview":"N/A","vote_average":6.6,"episodes":{"1":{"name":"A lei do porto","overview":"Há 30 anos, Joaquín Manchado comanda o porto de Barcelona com mão de ferro. Até que um inimigo inesperado ameaça seus negócios no tráfico de drogas.","air_date":"2024-03-15","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/glEVMnbb7VWocIic0tRFp1UAgSS.jpg","vote_average":7},"2":{"name":"Vida longa ao rei","overview":"Enquanto espera a chegada de uma nova remessa no porto, Joaquín faz cada vez mais inimigos. Román descobre uma verdade terrível.","air_date":"2024-03-15","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/l74QERtWLwuOIDcets6izALuyAi.jpg","vote_average":6.5},"3":{"name":"Trono de sangue","overview":"Começa a luta pelo poder, e o futuro da família Manchado é incerto. Víctor consolida sua posição. Uma traição provoca conflitos entre as facções.","air_date":"2024-03-15","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/hD9EtLMF0OAJjHTo02awggHN5Ua.jpg","vote_average":6.5},"4":{"name":"O dobro ou nada","overview":"Enquanto procura os contêineres perdidos, a família Manchado encara os inimigos e as brigas internas.","air_date":"2024-03-15","runtime":72,"still_path":"https://image.tmdb.org/t/p/original/bExE79cSRdCnmtbe4YMcePZnf3I.jpg","vote_average":6.5},"5":{"name":"Olho por olho, dente por dente","overview":"Román continua procurando Ricardo, e antigos conflitos de família voltam à tona. Víctor recebe notícias que poderiam mudar o rumo da investigação.","air_date":"2024-03-15","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/izGhj29gdK7uhRKDqh69WQQ5QSo.jpg","vote_average":6.5},"6":{"name":"Um mau presságio","overview":"Víctor segue uma pista e quase é descoberto por Miki. Ariel se arrisca. A pressão sobre a lavagem de dinheiro aumenta.","air_date":"2024-03-15","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/1sMvPNjjVaJ4aTCETdav6Utn7GL.jpg","vote_average":6.5},"7":{"name":"Encruzilhada","overview":"Rocío assume o controle dos negócios da família. A investigação de Víctor fica cada vez mais perigosa.","air_date":"2024-03-15","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/f0dWlFwbH2sH3JsARefamTP3V9z.jpg","vote_average":6.5},"8":{"name":"Uma questão de sangue","overview":"Víctor, Néstor e Rocío correm para encontrar a entrega perdida, transformando um funeral em um caos. Um golpe coloca uma vida em risco.","air_date":"2024-03-15","runtime":70,"still_path":"https://image.tmdb.org/t/p/original/eTIHhZeIIVSY5sC1HiGbOsqerpg.jpg","vote_average":6.8}}}}},
"117176":{"id":"117176","name":"O Exótico Dr. Ole","slug":"o-exotico-dr-ole","original_title":"The Wild Life of Dr. Ole","overview":"O veterinário Peter Olaf Alcumbrac, conhecido como Doutor Ole, pratica seu estilo único de tratamento de animais, com inteligência, técnica e astúcia.","first_air_date":"2021-01-18","episode_run_time":44,"vote_average":3,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["National Geographic","High Noon Entertainment"],"genres":["Documentário"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/lXHKO41PXt4C4UG5qVJqgRMc7dB.jpg","poster_path":"https://image.tmdb.org/t/p/original/l5g8WZAQVVmZ10zaqkkXCuCtnMU.jpg","cast":["Ole Alcumbrac","Andy Barnett"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/l5g8WZAQVVmZ10zaqkkXCuCtnMU.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/l5g8WZAQVVmZ10zaqkkXCuCtnMU.jpg","air_date":"2021-01-18","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Dramas de Um Antilocapra","overview":"O Doutor Ole atravessa o estado inteiro para verificar a saúde de um urso-negro e adota um adorável cãozinho como mascote da clínica.","air_date":"2021-01-18","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/gM438LZaS87hOzfjARDYKxiXEv1.jpg","vote_average":0},"2":{"name":"Tundra, Dentes e Garras","overview":"O Doutor Ole faz uma cirurgia de canal dupla em uma onça de 90 quilos, salva um gato de insuficiência renal e trata um cãozinho ferido.","air_date":"2021-01-25","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/lqy8tjOpV9UAGcST1TiWQxyCd6b.jpg","vote_average":0},"3":{"name":"Os Uivos e Os Pios","overview":"O Doutor Ole ajuda a reintegrar o lobo-mexicano, ameaçado de extinção, ao seu habitat natural, no Arizona, e solta uma coruja depois de tratar sua pata.","air_date":"2021-02-01","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/wsq63v3rwq1P8mM2wAfXBs9QP2b.jpg","vote_average":0},"4":{"name":"O Veterinário Detetive","overview":"O Doutor Ole ajuda um coelho que está perdendo pelo e usa a mais avançada tecnologia para transformar um jacaré amputado em um herói de ação.","air_date":"2021-02-08","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/vXEceTMpDrorti2CBLxAa0A7jm4.jpg","vote_average":0},"5":{"name":"Lá Vem o Urso","overview":"O Doutor Ole ajuda um urso-cinzento que tem um ferimento na pata e vacina girafas assustadas. Também opera a asa de um falcão e visita uma unidade de treinamento de cães de resgate.","air_date":"2021-02-15","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/wzRoBL1o6RXjXs6B9yVdXYlstow.jpg","vote_average":0},"6":{"name":"Dragões Independentes","overview":"O Doutor Ole examina uma infecção no ouvido de um porco-espinho, castra um petauro de açúcar e trata uma doença nos ossos de um dragão barbudo.","air_date":"2021-02-22","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/aqlHHKNaUPA5DMlktg0qSla2P2b.jpg","vote_average":0},"7":{"name":"Um Dia de Preguiça no Spa","overview":"O Doutor Ole trata o tumor de uma zebra chamada Serenity, os dentes de uma preguiça chamada Bart, castra um coelho chamado Dennis e faz pedicure em um velho amigo papagaio.","air_date":"2021-03-07","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/fOCjFi2se4keVCMGg6M5Qy3oV3c.jpg","vote_average":0},"8":{"name":"Lontras Sabidas","overview":"O Doutor Ole faz uma cesária em uma píton, opera a espinha de um gambá adorável chamado Flor e remove os pontos de cirurgia do olho de uma lontra.","air_date":"2021-03-15","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/qBhKNTw6UM2urUJe18JzgD6HP3p.jpg","vote_average":0}}}}},
